DescriptioN:

&quot;A surprisingly involving effort that's a take-off on the mainstream hit 'Sliding Doors,' this video stars Shayla LaVeaux in the Gwyneth Paltrow role. The flick shows how Shayla's seemingly innocuous decision whether to leave her friends' house or stay ends up having profound consequences for all aspects of her life. The whole thing's pretty silly, really, but it's done with enough humor and style that it all works. Shayla's especially good as the sexually driven woman from whom all the action flows. She shines in a pair of segments, first taking on Steve Hatcher in a steamy, high energy outing. Shayla's back for more in the vid's grand finale, a group grope that brings her into carnal contact with Coral Sands, T.J. Hart and a couple of well-equipped studs. In both scenes, Shayla's voracious sexual appetite drives the scene to some riveting and raunchy heights. Breasty Kylie Ireland also turns in some great work, hooking up with Kyle Stone in a blistering tryst before joining Elle DeVyne and Stone again for a raucous threeway. Elle even gets in one some back door boffing during this torrid and tenacious scene. T.J. Hart lends her tasty curves to a frantic opening scene, taking on Randy Spears in a riveting romp. The story is decent enough, but it's the between-the-sheets action that really drives this one. Great stuff for fans of Shayla or T.J.!&quot;

